import Router from "./src/components/Router";

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="Lista de tarefas">
        <Stack.Screen name="Lista de tarefas" component={TaskListPage} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}
